import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import "../styles/Navbar.css";
const Navbar = () => {
    const [isOpen, setIsOpen] = useState(false);

    const toggleNavbar = () => {
        setIsOpen(!isOpen);
    };

    return (
        <nav className="navbar">
            <div className="navbar-container">
                <button className="navbar-toggle" onClick={toggleNavbar}>
                    â˜°
                </button>
                <ul className={`navbar-menu ${isOpen ? 'open' : ''}`}>
                    <li><Link to="/" className='navbar-text' onClick={toggleNavbar}>Home</Link></li>
                    <li><Link to="/accepted" className='navbar-text' onClick={toggleNavbar}>Accepted</Link></li>
                    <li><Link to="/inprogress" className='navbar-text' onClick={toggleNavbar}>In Progress</Link></li>
                    <li><Link to="/pending" className='navbar-text' onClick={toggleNavbar}>Pending</Link></li>
                    <li><Link to="/completion-score" className='navbar-text' onClick={toggleNavbar}>Completion Score</Link></li>
                </ul>
            </div>
        </nav>
    );
};

export default Navbar;
